import { Box } from '@material-ui/core';
import axios from 'axios';
import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';
import './App.css';

function App() {

  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'https://api.themoviedb.org/3/discover/tv?api_key=92b418e837b833be308bbfb1fb2aca1e&language=fr-FR&sort_by=popularity.desc&page=1&timezone=America/New_York&include_null_first_air_dates=false',
      );

      setData(result.data.results);
    }

    fetchData();
  },[])

  console.log('%cApp.tsx line:25 data', 'color: #007acc;', data);
  return (
    <Box className="App">
      <header className="App-header">
      </header>
      <section>
        {/* <ul>
          {data.map((index, item) => {
            <li key={index}>
              <p>{item}</p>
            </li>
          })}
        </ul> */}
      </section>
    </Box>
  );
}

export default App;
